import React from "react";
import { Link } from "react-router-dom";

function Home() {
  return (
    <div className="Main">
      <div className="main-text">
        <p>지금 바로 </p>
        <p>당신만의 명함을 만들어보세요!</p>
      </div>
      <Link to="/signin" className="main-btn">
        GET STARTED!
      </Link>
      <p>내 명함을 실시간으로 공유 할 수도 있어요.</p>
    </div>
  );
}

export default Home;
